{
  const miniInf = 
  [
    {
      name:'Анна', num:'1', image:'/images/users/16 (1).png'
    },
    {
      name:'Василий', num:'2', image:'/images/users/16 (2).png'
    },
    {
      name:'Пётр', num:'3', image:'/images/users/16 (3).png'
    },
    {
      name:'Карина', num:'4', image:'/images/users/16 (4).png'
    },
    {
      name:'Вадим', num:'5', image:'/images/users/16 (5).png'
    },
    {
      name:'Светлана', num:'6', image:'/images/users/16 (6).png'
    },
    {
      name:'Максим', num:'7', image:'/images/users/16 (7).png'
    },
    {
      name:'Валерия', num:'8', image:'/images/users/16 (8).png'
    },
    {
      name:'Артур', num:'9', image:'/images/users/16 (9).png'
    },
    {
      name:'жАнна', num:'10', image:'/images/users/i (1).png'
    },
    {
      name:'Глеб', num:'11', image:'/images/users/16 (11).png'
    },
    {
      name:'Мария', num:'12', image:'/images/users/16 (12).png'
    },
  ]
    return(
      <div className={S.profiles}>
        {miniInf.map((mini) =>  (<div className={S.profile}>
    <Profile image={mini.image} name={mini.name} num={mini.num}/>
    </div>) )}
    </div>
    )
}

export default Profiles;
